import React from 'react'
import { Stack,TextField } from "@mui/material"

export const MuiTextField = () => {
  return (
      <Stack direction='row' spacing={2}>
         <TextField label ='Name' variant ></TextField> 
    </Stack>
  )
}

export default MuiTextField
